import PropTypes from 'prop-types';
import Link from 'next/link';

const AppLayout = ({ children }) => {
  return (
    <div>
      <div>
        <Link href="/">
          <a>supercoder</a>
        </Link>
        <Link href="/">
          <a>supercoder</a>
        </Link>
        <Link href="/">
          <a>supercoder</a>
        </Link>
        <Link href="/">
          <a>supercoder</a>
        </Link>
      </div>
      {children}
    </div>
  );
};

AppLayout.propTypes = { children: PropTypes.node.isRequired };

export default AppLayout;
